import React from 'react';

const AnnualScienceFair = () => {
  return (
    <div className="event-page">
      <h1>Annual Science Fair</h1>
      <p>Showcasing student innovations and creativity.</p>
      <p>Date: October 15, 2023</p>
      <p>Location: School Auditorium</p>
      <button onClick={() => window.history.back()} className="modern-btn">Go Back</button>
    </div>
  );
};

export default AnnualScienceFair;
